    const {handlealphaCheckBox} = Context.bunchaFunctions
    const {alphacheckBoxStatus} = Context.bunchaFunctions
    
return (<Checkbox
    checked = {alphacheckBoxStatus}
    //isSelected={this.state.checkboxes[option]}
